/**
 * 仪表盘页面
 * 使用DashboardLayout布局
 */

import React, { useEffect, useState } from 'react';
import { useAuth } from '../contexts/AuthContext';
import '../styles/DashboardPage.css';

// 导入原有的App.tsx中的组件和功能
import SearchBox from '../components/SearchBox';
import StockChart from '../components/StockChart';

const DashboardPage: React.FC = () => {
  const { user } = useAuth();
  const [stockData, setStockData] = useState<any>(null);
  const [loading, setLoading] = useState<boolean>(false);
  const [error, setError] = useState<string | null>(null);
  const [searchTerm, setSearchTerm] = useState<string>('');

  // 处理股票搜索
  const handleSearch = async (term: string) => {
    if (!term.trim()) return;

    setSearchTerm(term);
    setLoading(true);
    setError(null);

    try {
      const response = await fetch(`/api/stock/${term}`);
      if (!response.ok) {
        throw new Error(`股票数据获取失败: ${response.statusText}`);
      }

      const data = await response.json();
      setStockData(data);
    } catch (err: any) {
      setError(err.message || '获取股票数据时出错');
      console.error('获取股票数据时出错:', err);
    } finally {
      setLoading(false);
    }
  };

  // 初始加载一些默认数据
  useEffect(() => {
    // 可以加载用户的收藏股票或者热门股票
    const loadDefaultStocks = async () => {
      try {
        const response = await fetch('/api/stocks/popular');
        if (response.ok) {
          const data = await response.json();
          // 处理数据...
        }
      } catch (error) {
        console.error('加载默认股票数据失败:', error);
      }
    };

    loadDefaultStocks();
  }, []);

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>股票看板</h1>
        <p>欢迎回来, {user?.username || '用户'}!</p>
      </div>

      <div className="dashboard-search">
        <SearchBox onSelectStock={(stock) => handleSearch(stock.code)} placeholder="搜索股票代码或名称" />
      </div>

      <div className="dashboard-content">
        {loading ? (
          <div className="loading-container">
            <div className="loading-spinner"></div>
            <p>加载中...</p>
          </div>
        ) : error ? (
          <div className="error-container">
            <p className="error-message">{error}</p>
            <button onClick={() => handleSearch(searchTerm)}>重试</button>
          </div>
        ) : stockData ? (
          <div className="stock-data-container">
            <div className="stock-info">
              <h2>{stockData.name} ({stockData.symbol})</h2>
              <div className="stock-price">
                <span className={`price ${stockData.change >= 0 ? 'positive' : 'negative'}`}>
                  {stockData.price}
                </span>
                <span className={`change ${stockData.change >= 0 ? 'positive' : 'negative'}`}>
                  {stockData.change >= 0 ? '+' : ''}{stockData.change} ({stockData.changePercent}%)
                </span>
              </div>
            </div>

            <div className="stock-chart-container">
              <StockChart 
                visible={!!stockData} 
                onClose={() => setStockData(null)} 
                stockCode={stockData.symbol} 
                stockName={stockData.name} 
              />
            </div>

            <div className="stock-details">
              <div className="detail-item">
                <span className="detail-label">开盘价</span>
                <span className="detail-value">{stockData.open}</span>
              </div>
              <div className="detail-item">
                <span className="detail-label">最高价</span>
                <span className="detail-value">{stockData.high}</span>
              </div>
              <div className="detail-item">
                <span className="detail-label">最低价</span>
                <span className="detail-value">{stockData.low}</span>
              </div>
              <div className="detail-item">
                <span className="detail-label">收盘价</span>
                <span className="detail-value">{stockData.close}</span>
              </div>
              <div className="detail-item">
                <span className="detail-label">成交量</span>
                <span className="detail-value">{stockData.volume}</span>
              </div>
            </div>
          </div>
        ) : (
          <div className="empty-state">
            <p>请搜索股票代码或名称以查看详细信息</p>
            <div className="popular-stocks">
              <h3>热门股票</h3>
              <div className="stock-tags">
                <button onClick={() => handleSearch('AAPL')}>苹果 (AAPL)</button>
                <button onClick={() => handleSearch('MSFT')}>微软 (MSFT)</button>
                <button onClick={() => handleSearch('GOOGL')}>谷歌 (GOOGL)</button>
                <button onClick={() => handleSearch('AMZN')}>亚马逊 (AMZN)</button>
                <button onClick={() => handleSearch('TSLA')}>特斯拉 (TSLA)</button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default DashboardPage;
